Thales è un gruppo d'elettronica specializzato nell'aerospaziale, nella difesa, nella sicurezza e nel trasporto terrestre.La società è quotata alla borsa di Parigi, è presente in 56 paesi e impiega 64 000 dipendenti al 31 dicembre 2016, Thales è uno dei leader mondiali degli apparecchi destinati all'industria dell'aeronautica, dello spazio, della difesa, della sicurezza e delle modalità di trasporto. Le origini del gruppo risalgono al 1968, quando la branca specializzata di elettronica professionale di Thomson-Brandt si è fusa con per creare Thomson-CSF. Un'altra data chiave è il 1998, quando le branche specializzate nelle attività militari di Alcatel, Dassault Électronique e Thomson-CSF si sono riunite per formare una nuova società (che si chiamerà sempre Thomson-CSF). Alla fine del 2000, anche a seguito dell'acquisizione di , la società prende il nome attuale: Thales.Il nome Thales deriva da quello del filosofo, matematico e astronomo greco Talete (che in francese si scrive Thalès), ma è ugualmente un acronimo per le principali entità del gruppo: TH per Thomson-CSF, AL per o e ES per Electronic Systems. In francese si pronuncia taˈles . Il gruppo è organizzato in maniera matriciale: per zone geografiche e per settori di attività nei quali il gruppo dispone di una capacità a sviluppare dei sistemi critici disponendo di un mercato internazionale: 
* aerospaziale (aeronautica, spazio); 
* trasporto (sistemi di trasporto terrestre); 
* difesa e sicurezza (sistemi d'informazione e di comunicazioni sicuri, sistemi terrestri e aerei, sistemi di missione di difesa). Dal 2019 é divenuta il più grande produttore mondiale di schede SIM per telefoni cellulari dopo l'acquisizione di Gemalto. È membro dell'Istituto europeo per le norme di telecomunicazione (ETSI).
